import React from "react";

const Input=({value,onChange,onSubmit})=>{
    return(
        <div className="btm">
            <div className="input">
            <input
                type="text"
                value={value}
                onChange={onChange}
                placeholder="Enter your Message"
            />
            <div className="btn">
                <button >
                    <i className="fa fa-paper-plane"></i>Send
                </button>
            </div>
        </div>
        </div>
        
    )
}

export default Input;
